INSERT INTO `ABOUT` VALUES (1,'Eric Gagnon - Courtier Immobilier','Eric Gagnon - Real Estate Broker','Equipo Eric Gagnon Inmobiliario','Eric Gagnon vous offre son expérience solide du marché de l\'immobilier, son professionnalisme reconnu et son réseau d\'acheteurs sérieux. Votre projet, petit ou grand, sera un succès grâce à Eric!','Eric Gagnon offers you its solid experience in the real estate market, its recognized professionalism and its network of serious buyers. Your project, large or small, will be a success thanks to Eric!','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce sed purus nunc. Ut non lacus in nunc pulvinar ultrices. Sed in sollicitudin tellus. Phasellus semper libero ac suscipit vulputate. Nunc congue elit eget lorem iaculis, vitae elementum urna bibendum.','<p>Eric Gagnon vous offre son exp&eacute;rience solide du march&eacute; de l&#39;immobilier, son professionnalisme reconnu et son r&eacute;seau d&#39;acheteurs s&eacute;rieux. Votre projet, petit ou grand, sera un succ&egrave;s gr&acirc;ce &agrave; Eric!</p>','<p>Eric Gagnon offers you its solid experience in the real estate market, its recognized professionalism and its network of serious buyers. Your project, large or small, will be a success thanks to Eric!</p>','<p>El equipo de Eric Gagnon Bienes Ra&iacute;ces, B&eacute;lgica Bosnia icto profesionalidad reconnu, red icto de compradores y vendedores y fuerte experiencia en el mercado. Grande o peque&ntilde;o sea su proyecto sea un &eacute;xito.</p>','/images/aboutOG.jpg','/beta/themes/eg/images/logomini_fr.jpg','/images/profile.jpg');
