CREATE TABLE `CARACTERISTIQUES` (
  `NO_INSCRIPTION` varchar(14) DEFAULT NULL,
  `TCAR_CODE` varchar(4) DEFAULT NULL,
  `SCARAC_CODE` varchar(4) DEFAULT NULL,
  `NOMBRE` tinyint(6) DEFAULT NULL,
  `INFORMATIONS_FRANCAISES` varchar(60) DEFAULT NULL,
  `INFORMATIONS_ANGLAISES` varchar(60) DEFAULT NULL,
  UNIQUE KEY `NO_INSCRIPTION` (`NO_INSCRIPTION`,`TCAR_CODE`,`SCARAC_CODE`),
  KEY `TCAR_CODE` (`TCAR_CODE`),
  KEY `SCARAC_CODE` (`SCARAC_CODE`),
  CONSTRAINT `CARACTERISTIQUES_ibfk_1` FOREIGN KEY (`NO_INSCRIPTION`) REFERENCES `INSCRIPTIONS` (`NO_INSCRIPTION`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `CARACTERISTIQUES_ibfk_2` FOREIGN KEY (`TCAR_CODE`) REFERENCES `TYPE_CARACTERISTIQUES` (`CODE`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `CARACTERISTIQUES_ibfk_3` FOREIGN KEY (`SCARAC_CODE`) REFERENCES `SOUS_TYPE_CARACTERISTIQUES` (`CODE`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
