ice de sécurité 24 heures, navette vers le centre-ville, d\'une piscine intérieure et beaucoup plus. Cliquez sur icône pour visite virtuelle immersive. '),('9649402',2,'A',1,'','','2 bedroom condo with superb terrace and balcony. The large windows offer luminosity and a magnificent view of downtown and Mount-Royal. At the Profil-O you benefit of: a 24hr security service, shuttle service to go downtown, an indoor swimming pool with an outdoor terrace and a lot more. Press icon for virtual immersive visit.'),('9846265',1,'F',1,'','','Belle maison semi-détaché située dans une rue tranquille. Profitez de 3 càc spacieuses, espace à air ouvert, grandes fenêtres avec beaucoup de lumière naturelle. Proche de toutes commodités, écoles, transports en commun, la gare Pincourt-Terrasse-Vaudreuil. Emplacement parfait et sans danger pour les enfants. A voir absolument!'),('9846265',2,'A',1,'','','Beautiful semi-detached home located in a quiet street. Enjoy 3 spacious bedrooms, open concept living space, big windows with lots of natural light. Close to all amenities, schools, public transportation, Pincourt-Terrasse-Vaudreuil train station. Perfect and safe location for children. A MUST SEE!'),('9877140',1,'F',1,'','','Vivez avec panache. Commodité, intimité et sécurité au Canal. Conçu pour le confort! Un luxueux condo avec une chambre plus un den situé sur la rive du canal Lachine. À proximité du marché Atwater, à deux pas du centre-ville et tous les services. Entre nous, tout le monde sait très bien que la vie est plus agréable au Griffintown! '),('9877909',1,'F',1,'','','Magnifique condo à deux pas du marché Atwater et Canal Lachine. Profitez d\'un espace lumineux, planchers de bois, cuisine-salle à manger-salon à aire ouverte, chambre  à coucher spacieuse, grande terrasse privée. Parfait pour un jeune couple ou un jeune professionnel. Un emplacement ideal, près de toutes les commodités. A VOIR ABSOLUMENT!'),('9877909',2,'A',1,'','','Beautiful condo walking distance to Atwater