ce.'),('12460604',1,'F',1,'','','Grand 1 chambre de vrai qualité. Unité avec balcon vous offrant fenestration, espace et confort. Construction de béton qui a fait ses preuves. Adresse exceptionnelle au coeur d\'une zone verte composée de trois parcs magnifiques. Terrasse sur toit avec pleine vue sur fleuve, centre-ville, pont, fleuve, plateau.Transports à 2 minutes de marche.'),('12460604',2,'A',1,'','','Large 1 bedroom. Unit with balcony, large windows, space and comfort. Wood floor, large kitchen with island, great soundproof. Exceptional address at the heart of green area composed of three beautiful parks. Roof terrace with panoramic view on the river, bridge, Plateau, downtown and international fireworks. All major road and transport services. '),('12466520',1,'F',1,'','','PRESTIGIEUSE unité de coin. Grand 2 chambres + grand Den. Fenestration et luminosité abondante. Haut plafond et grande terrasse. Vue panoramique extraordinaire sur le fleuve et la ville. Piscine, gym, sauna, bain vapeur, service de navette privée centre-ville. Le calme de la campagne en ville sur le bord du fleuve. Une qualité de vie assurée!'),('12466520',2,'A',1,'','','LUXURY cornet unit. Large 2 bedroom + Den. Larges Windows and abundant light. High ceiling and large terrace. Extraordinary panoramic view of the river and city. Pool, gym, spa, steam bath, private shuttle service downtown. . The quiet of the countryside in downtown on the edge of the river. Assured quality of life!'),('12502665',1,'F',1,'','','Magnifique Bungalow avec 2+2 càc!Profitez d\'un espace lumineux à air ouvert,planchers de bois,beaucoup de fenêtres,sous-sol fini 6\'3\" bien aménagé avec grande salle familiale,2 càc et sdb complète,charmante petite cours avec grand espace couvert et cabanon,à 6 minutes de la gare de Blainville,à proximité de transports commun et de tous les services'),('12502665',2,'A',1,'','','Beautiful 2+2 bedrooms bungalow! Enjoy bright open concept living space, wood floors throughout, lots of win