o and balcony with beautiful views of the city and the mountains, elevator, garage and storage space.'),('16044345',1,'F',1,'','','Magnifique et spacieuse maison a 2 étages au bord de l\'eau! Profitez de 4 càc, 2+1 sdb, grand salon avec foyer au bois, grandes fenêtres, cuisine avec armoires en bois, chambre des maîtres avec vues du lac, jardin ensoleillé avec piscine hors terre et plage privée avec vues de la rivière des Outaouais, 3 espaces de stationnement et plus encore.'),('16044345',2,'A',1,'','','Beautiful and spacious 2 story waterfront home! Enjoy 4 bedrooms, 2+1 bathrooms, large living room with wood fireplace, large windows throughout, Gourmet kitchen with wood cabinets, large master bedroom with water views, sunny backyard with above ground pool and private beach with views of the Ottawa river. 3 garage spaces and more. A must see!'),('16104545',1,'F',1,'','','Superbe penthouse située dans le secteur dynamique de Griffintown. Le projet Lowney se trouve prêt du Centre-Ville, Vieux-Montréal, Canal Lachine et Pont Victoria. Cuisine à concept ouvert, une très belle salle de bain, un grand balcon. Accès à 4 terrasses sur les toits avec piscines, BBQ, espace détente, un gym avec piscine intérieur et 2 saunas.'),('16104545',2,'A',1,'','','Superbe penthouse situated in the dynamic secteur of Griffintown. The Lowney project is strategically placed near downtown, Old- Montréal, Lachine Canal and Victoria bridge. Open-concept kitchen, beautiful bathroom, large balcony. Access to 4 rooftop terraces with a pool, BBQ, lounge area, a gym, 2 saunas and an indoor pool.   '),('16116474',1,'F',1,'','','Reprise de finance à ne pas manquer.Super aubaine!!!'),('16235810',1,'F',1,'','','NOUVEAU Projet Le Belvédère St-Laurent. Unité avec vue panoramique sur le fleuve St-Laurent, le pont Jacques-Cartier et les feux d\'artifices. Construction de béton et acier avec hauts plafonds et insonorisation supérieure. Comptoirs de quartz dans la cuisine et la salle de bain. Possibilité d\'acheter un garage. Petit projet de 8 unités. '),('16235810',2,'A',1,'','','NEW Project Le Belvédère St-Laurent. Unit with panoramic view of the St-Laurent river, the Jacques-Cartier Bridge and the fireworks. Concrete and steel construction with high ceilings and superior soundproofing. Quartz countertops in the kitchen and the bathroom. Possibility to buy a garage. Small project of 8 units.'),('16277678',1,'F',1,'','','Grande unité 1 chambre avec vue panoramique sur Plateau et  centre-ville. Condo situé de facon a recevoir beaucoup de soleil et un superbe couché de soleil. Prix compétitif. Grande fenestration. Cuisine fonctionnelle, SDB de luxe.  Belle terrasse sur toit avec pleine vue sur Plateau,feux d\'artifice, fleuve, pont.À distance de tous services & metro.'),('16277678',2,'A',1,'','','Large 1 bedroom unit with panoramic Plateau, downtown. Condo located way to receive lots of sun and a beautiful sunset. Competitive price. Large windows. Functional kitchen, luxury bathroom. Beautiful roof terrace with full view of Plateau, fireworks and River. Building great.'),('16304642',1,'F',1,'','','Profil O, magnifique condo ensoleillé offrant élégance et design dans les moindres détails. Immenses fenêtres donnant des vues imprenables, superbes planchers, maintenant 2 cac (peut facilement être reconverti en 3), 2 sdb, balcon, terrasse, 2 garages en plus des services offerts dans l\'immeuble. Cliquez sur icône pour visite immersive.'),('16304642',2,'A',1,'','','Profil O, magnificent & bright condo offering elegance and design down to the smallest details.  The large windows give breathtaking views. Superb wood floors, NOW 2 bedrooms (can easily be converted to 3), 2 bathroom, balcony, terrace and 2 garages without counting all the services offered by the building. Press icon for immersive visit.'),('16450006',1,'F',1,'','','Unique Condo-loft dans bâtiment classé Immeuble de valeur patrimoniale exceptionnelle.Haut plafond, mur de brique exposé,colonnes de bois apparentes, 