l, Lionel-Groulx Metro station and bicycle path.'),('17326103',1,'F',1,'','','**Très beau condo dans le LOWNEY .Belle fenestration et plafond de 13 pieds. Chalet urbain avec foyer, piscine extérieure, BBQ, gym, piscine d\'entraînement. À proximité du centre-ville, Canal Lachine, Vieux -Montreal.A VOIR !!'),('17326103',2,'A',1,'','','**Charming condo in historic building steps from Downtown and Old Montreal. Enjoy open concept, finished wood floors, brick wall detailing, high ceilings. Rooftop terrace with pool and incredible view of Downtown. COME VISIT!!'),('17330708',1,'F',1,'','','Localisation de choix en plein coeur du centre-ville au Séville. Présentement loué jusqu\'à fin Aout 2016. Condo au 6e étage avec vue. Concept à aire ouverte avec une chambre à coucher fermée et un balcon. 2 piscines, chalet urbain, terrasses aménagées et paysagées avec plusieurs BBQ, salle de billard, gym, sauna. Métro Atwater. Hôpital.'),('17330708',2,'A',1,'','','Top location in the heart of downtown Montreal at Le Séville.This condo is presently rented untill end of August. Condo on 6th floor with a great view. One closed bedroom and a small balcony. Poolroom, sauna, gym, 2 pools, urban chalet, furnished and landscaped terraces with several BBQ. Atwater metro station. Concordia University. Hospital.'),('17667268',1,'F',1,'','','UNE ADRESSE DE PRESTIGE! Le William: Magnifique Penthouse situé au coeur du Griffintown. Décor paisible, élégant et discret. Détendez-vous dans la paisible intimité de votre terrasse privée. À proximité de tous les services. Il faut faire vite! Cette location n\'attendra pas. '),('17705952',1,'F',1,'','','Magnifique appartement de 3 càc au coeur du Plateau Mont-Royal! Profitez de moulures originales de 120 ans, hauts plafonds, mur de briques, foyer, électro en acier inoxydable, 2 sdb complètes, bureau séparé, grand patio privé et un espace de stationnement. À quelques pas du Parc Lafontaine, métro Sherbrooke, épiceries et plus encore.'),('17705952',2,'A',1,''