sities, downtown, subway (orange line) ...'),('26825603',1,'F',1,'','','Localisation idéale! Penthouse moderne à aire ouverte dans le Paris Lofts vous offre des vues spectaculaires de la ville et de la montagne, un grand balcon privé, de très haut plafonds en béton & planchers de bois. Situé au coeur du Plateau Mont-Royal. À quelques pas de tous les services, bus, métro et du Boul. St-Laurent. Unité rare dans le projet'),('26825603',2,'A',1,'','','Unbeatable location! Open concept modern Penthouse at the Paris Lofts offers city & mountain views, large private balcony, high concrete ceilings & hard wood floors throughout. Located in the heart of the Plateau Mont-Royal only steps to all amenities and St-Laurent Boulevard. Walking distance to bus & metro.'),('27391786',1,'F',1,'','','Profitez des accommodations luxueuses au Royale Westmount avec ses vues panoramiques, les magnifiques jardins, le service de portier et beaucoup plus. Les vues spectaculaires du centre-ville, la montagne et la rivière sont visibles de plusieurs suites ainsi que la piscine intérieure sur le toit. Le Royale Westmount est une entreprise familiale. '),('27391786',2,'A',1,'','','The very prestigious Royal Westmount offers the finest luxury living. Enjoy panoramic views from the roof top indoor pool or from one of the many suites with views of the city, the river and the mountain. This full-service building offers a full-time doorman. Enjoy the award winning grounds and gardens. This family run building is sure to impress!'),('27394042',1,'F',1,'','','Belle maison de ville située dans une rue tranquille. Profitez de 3 càc spacieuses, espace à air ouvert, grandes fenêtres avec beaucoup de lumière naturelle. Proche de toutes commodités, écoles, transports en commun, la gare Pincourt-Terrasse-Vaudreuil. Emplacement parfait et sans danger pour les enfants. A voir absolument!'),('27394042',2,'A',1,'','','Beautiful townhouse located in a quiet street. Enjoy 3 spacious bedrooms, open concept living space, big windows with lots of natural light. Close to all amenities, schools, public transportation, Pincourt-Terrasse-Vaudreuil train station. Perfect and safe location for children. A MUST SEE!'),('27719827',1,'F',1,'','','À partir du 25 Mars 2016.Unité exceptionnelle de coin avec grande fenestration et naturelle. Vue à couper le souffle sur la ville, le Pont Jacques-Cartier et les feux d\'artifices! Plafonds de 9\'7\'\', planchers de bois franc exotique, granite. Localisation de choix au coeur des pôles culturels, du night-life et des services de transport en commun.'),('27719827',2,'A',1,'','','From March 25th 2016. Exceptional corner unit many windows and amazing natural light. The best panoramic view on Downtown, the Jacques-Cartier Bridge and the fireworks! At walking distance to everything. 9\'7\" ceilings, exotic hardwood floors, granite. Great location in the heart of cultural and night life and public transit. '),('28057277',1,'F',1,'','','Maison rénové dans un secteur en demande. Profitez de planchers en bois, cuisine de chef avec cuisinière au gaz de 60\'\', foyer au gaz, garage attaché, spa extérieur, grande court privée & Plus! 3 minutes de marche au métro Charlevoix ainsi que tous les services. À quelques pas du marché Atwater. Meublé & tout inclus. Nettoyage aux 2 semaines inclus'),('28057277',2,'A',1,'','','Renovated detached house in prime location! Enjoy hard wood floors, gourmet kitchen with 60\'\' gas range, gas fireplace, attached garage, outdoor spa, large private yard & much more. 3 minute walk to Charlevoix metro and walking distance to all amenities. Steps to atwater market. Fully furnished & all inclusive. Cleaning included every 2 weeks. '),('28095572',1,'F',1,'','','Avec ses murs de brique, son haut plafond et sa grande superficie ce commerce a également une grande vitrine d\'exposition qui donne directement sur Saint-Denis. De plus, l\'accessibilité en métro via la station Sherbrooke facilite l\'accès à votre commerce pour votre clientèle. Une visite s\'impose!!!'),('28153470',1,'F',1,'','','NOUVEAU Projet Le Belvédère St-Laurent. Unité avec vue panoramique sur le fleuve St-Laurent, le pont Jacques-Cartier et les feux d\'artifices. Construction de béton et acier avec hauts plafonds et insonorisation supérieure. Comptoirs de quartz dans la cuisine et la salle de bain. Possibilité d\'acheter un garage. Petit projet de 8 unités. '),('28153470',2,'A',1,'','','NEW Project Le Belvédère St-Laurent. Unit with panoramic view of the St-Laurent river, the Jacques-Cartier Bridge and the fireworks. Concrete and steel construction with high ceilings and superior soundproofing. Quartz countertops in the kitchen and the bathroom. Possibility to buy a garage. Small project of 8 units.'),('28346420',1,'F',1,'','','Profitez des accommodations luxueuses au Royale Westmount avec ses vues panoramiques, les magnifiques jardins, le service de portier et beaucoup plus. Les vues spectaculaires du centre-ville, la montagne et la rivière sont visibles de plusieurs suites ainsi que la piscine intérieure sur le toit. Le Royale Westmount est une entreprise familiale. '),('28346420',2,'A',1,'','','The very prestigious Royal Westmount offers the finest luxury living. Enjoy panoramic views from the roof top indoor pool or from one of the many suites with views of the city, the river and the mountain. This full-service building offers a full-time doorman. Enjoy the award winning grounds and gardens. This family run building is sure to impress!'),('28532479',1,'F',1,'','','Condo 2 chambres au dernier étage offrant une vue dégagée sur la rive-sud et le Mont Royal! De grandes fenêtres dans le salon et chambre des maîtres - grand hall d\'entrée, 2 balcons, un dans le salon et un dans la chambre - salle de bains avec une douche et 2 lavabos - cuisine avec comptoirs en granite. '),('28532479',2,'A',1,'','','New condo 2 bedrooms on the last floor offering a view of the river and the Mont Royal!! Large windows in the living room and the  master bedroom - 2 private balconies, one in the living room and a second in the bedroom - Spacious bathroom with a shower - kitchen with granite counters. Stainless steel appliances included. '),('28580685',1,'F',1,'','','Profitez des accommodations luxueuses au Royale Westmount avec ses vues panoramiques, les magnifiques jardins, le service de portier et beaucoup plus. Les vues spectaculaires du centre-ville, la montagne et la rivière sont visibles de plusieurs suites ainsi que la piscine intérieure sur le toit. Le Royale Westmount est une entreprise familiale. '),('28580685',2,'A',1,'','','The very prestigious Royal Westmount offers the finest luxury living. Enjoy panoramic views from the roof top indoor pool or from one of the many suites with views of the city, the river and the mountain. This full-service building offers a full-time doorman. Enjoy the award winning grounds and gardens. This family run building is sure to impress!'),('28607526',1,'F',1,'','','Idéalement située de le secteur Golden Square Mile,cette structure en pierre unique est sans précédent dans le secteur de Ville-Marie.Cette maison au 1500 Ave.Dr Penfield fera dorénavant partie d\'une série de maisons de ville au coin de la rue Simpson et Docteur Penfield.Très belle opportunité d\'investissement à acheter et rénover en maison de rêve'),('28607526',2,'A',1,'','','Perfectly located off the Golden Square Mile, this unique stone structure is unparalleled in the Ville Marie area. Once the coach house to 1500 Ave. Dr-Penfield, will now be part of a row of prestigious townhouses on the corner of Simpson street and Doctor-Penfield avenue. Wonderful investment opportunity to buy and renovate into a dream home.'),('28902335',1,'F',1,'','','Édifice de luxe en béton au coeur du centre ville de Montréal. Profitez des vues spectaculaires et des fenêtres pleine hauteur. Superbes cuisines modernes avec électros en acier inoxydable et comptoirs en granite. Planchers de bois. Sécurité 24h,gym, piscine, terrasse, salle de cinéma et espace de réception. Construction insonorisé.'),('28902335',2,'A',1,'','','Luxury concrete high rise building in the heart of downtown Montreal. Enjoy floor to ceiling windows with breath taking views, modern kitchens with granite counter tops and stainless steel appliances and hard wood floors throughout. 24 hour doorman, salt water pool, sun deck, gym, steam room, cinema room and reception hall. Soundproof construction.'),('28905153',1,'F',1,'','','Édifice de luxe en béton au coeur du centre ville de Montréal. Profitez des vues spectaculaires et des fenêtres pleine hauteur. Superbes cuisines modernes avec électros en acier inoxydable et comptoirs en granite. Planchers de bois. Sécurité 24h,gym, piscine, terrasse, salle de cinéma et espace de réception. Construction insonorisé.'),('28905153',2,'A',1,'','','Luxury concrete high rise building in the heart of downtown Montreal. Enjoy floor to ceiling windows with breath taking views, modern kitchens with granite counter tops and stainless steel appliances and hard wood floors throughout. 24 hour doorman, salt water pool, sun deck, gym, steam room, cinema room and reception hall. Soundproof construction.');
