INSERT INTO `THEMES` VALUES (2,1,'propiolab','images/preview_main.jpg','\r\n	@import url(http://fonts.googleapis.com/css?family=Lato);\r\n*{\r\n	margin:0;\r\n	padding:0;\r\n	font-family: Lato, Helvetica, serif;\r\n    border:none;\r\n}	\r\n\r\nbody {\r\n	background: url(/themes/main/images/cream_pixels.png);\r\n	background-size: 6%;\r\n}\r\n.clearFloat{clear:both;}\r\na{text-decoration:none}\r\nul{list-style:none;}\r\n\r\n.main{\r\n	background:#FFF;\r\n	margin-top: 30px;\r\n}\r\n\r\n\r\n#black-machine{\r\n	width: 50%;\r\n	background: url(/themes/main/images/binding_dark.png);\r\n	background-size: 16%;\r\n	position: absolute;\r\n	top: 0;\r\n	right: 50%;\r\n	height:80px;\r\n	z-index: -1;\r\n}\r\n#blue-machine{\r\n	width: 50%;\r\n	background: $color2;\r\n	position: absolute;\r\n	top: 0;\r\n	left: 50%;\r\n	height:80px;\r\n	z-index: -1;\r\n}\r\n\r\n.black_inMachine{\r\n	background: url(/themes/main/images/binding_dark.png);\r\n	background-size: 37%;\r\n	width: 30%;\r\n	height: 80px;\r\n	float: left;\r\n}\r\n\r\n.blue_inMachine{\r\n	background: $color2;\r\n	width: 70%;\r\n	height: 80px;\r\n	float: left;\r\n}\r\n	\r\nheader{\r\n	box-shadow: 0 2px 6px 0 rgba(50, 50, 50, 0.35);\r\n}\r\n\r\nfigure{\r\n	width:1024px;\r\n	margin:auto;\r\n	height:350px;\r\n	position:relative;\r\n}\r\n\r\nfooter{\r\n	color: $fontcolor3;\r\n	margin-top: 200px;\r\n	text-align: center;\r\n	padding: 20px 0;\r\n	font-size: 12px;\r\n	background: url(/themes/main/images/binding_dark.png);\r\n	background-size: 6%;\r\n	}\r\n\r\n.prm-btn{\r\n	color: $fontcolor2;\r\n	font-size: 16px;\r\n	cursor: pointer;\r\n	background: $color3;\r\n	padding: 7px 0;\r\n	display: block;\r\n	width: 120px;\r\n	text-align: center;\r\n	margin: 8px 0;\r\n}\r\n\r\n.prm-btn:hover{opacity:0.8;}\r\n\r\n.feature_img{\r\n	max-width: 100px;\r\n	overflow: hidden;\r\n	height: 100px;\r\n	margin: auto;\r\n}\r\n\r\n.text_descr{\r\n	font-size: 14px;\r\n	line-height: 160%;\r\n}\r\n\r\n.title_header{\r\n	margin: 0 15px;\r\n	padding: 15px 0;\r\n	border-bottom: 1px dotted #ccc;\r\n	font-size: 24px;\r\n	color:$fontcolor1;\r\n}\r\n#contact_form{margin: 15px 0 0 15px;}\r\n.fill_form {\r\n	background: none repeat scroll 0 0 #E8E8E8;\r\n	border-bottom: 1px solid #1B1B1B;\r\n	font-size: 14px;\r\n	margin-bottom: 8px;\r\n	padding: 8px 10px;\r\n	width: calc(100% - 20px);\r\n	font-family: Lato, Helvetica, serif;\r\n	border-radius: 0;\r\n}\r\n\r\n.fill_form:focus{\r\n    border: 1px solid $color1;\r\n}\r\n\r\n.info img{\r\n	display:block;\r\n	width:20px;\r\n	float:left;\r\n	margin-right:10px;\r\n}\r\n\r\n.link_decoration:link{\r\n	color:#929292;\r\n	text-decoration:none;\r\n}\r\n	\r\n.link_decoration:visited{\r\n	color:#929292;\r\n	text-decoration:none;\r\n}\r\n\r\n#logo{\r\n	float: left;\r\n	width: 180px;\r\n	display: block;\r\n	}\r\n\r\n.home_content{\r\n	text-align:center;\r\n	background:$color2;\r\n	color:$fontcolor2;\r\n	padding:20px;\r\n	border-left:2px solid $color1;\r\n	margin-top: 40px;\r\n}\r\n\r\n.demandCallOut{\r\n	background: #1F1F1F;\r\n	color: #fff;\r\n	padding: 12px 20px;\r\n	margin-bottom: 10px;\r\n	font-size: 17px;\r\n	text-shadow: 1px 1px 1px #000000;\r\n}\r\n\r\n.demandCallOut span{\r\n	text-transform: uppercase;\r\n	font-size: 18px;\r\n}\r\n\r\n.quote{\r\n	position: absolute;\r\n	width: 100%;\r\n	left: 0;\r\n	top: 50%;\r\n	-webkit-transform: translate(20px, 50%);\r\n	transform: translate(20px, 50%);\r\n	line-height: 120%;\r\n	\r\n}\r\n.quote h2{\r\n	font-size:18px;\r\n}\r\n\r\n.quote span	{color:$color2;}\r\n\r\n.test_content{\r\n	font-style: italic;\r\n	color: #5A5A5A;\r\n	font-size: 14px;\r\n	line-height: 130%;\r\n	background: rgba(242, 242, 242, 0.93);\r\n	padding: 14px 15px;\r\n}\r\n\r\n.test_content i{\r\n	font-size: 15px;\r\n	padding: 0 10px;\r\n	display: inline-block;\r\n	color: #414141;\r\n}\r\n\r\n.test_content p{display: inline;}\r\n\r\n.service_text{\r\n	float:left;\r\n	width:600px;\r\n	margin-left:20px;\r\n}\r\n\r\n.fancybox{\r\n	display: block;\r\n	height: 180px;\r\n	overflow: hidden;\