ColorBox*/\r\n/*\r\n    Colorbox Core Style:\r\n    The following CSS is consistent between example themes and should not be altered.\r\n*/\r\n#colorbox, #cboxOverlay, #cboxWrapper{position:absolute; top:0; left:0; z-index:9999; overflow:hidden;}\r\n#cboxWrapper {max-width:none;}\r\n#cboxOverlay{position:fixed; width:100%; height:100%;}\r\n#cboxMiddleLeft, #cboxBottomLeft{clear:left;}\r\n#cboxContent{position:relative;}\r\n#cboxLoadedContent{overflow:auto; -webkit-overflow-scrolling: touch;}\r\n#cboxTitle{margin:0;}\r\n#cboxLoadingOverlay, #cboxLoadingGraphic{position:absolute; top:0; left:0; width:100%; height:100%;}\r\n#cboxPrevious, #cboxNext, #cboxClose, #cboxSlideshow{cursor:pointer;}\r\n.cboxPhoto{float:left; margin:auto; border:0; display:block; max-width:none; -ms-interpolation-mode:bicubic;}\r\n.cboxIframe{width:100%; height:100%; display:block; border:0; padding:0; margin:0;}\r\n#colorbox, #cboxContent, #cboxLoadedContent{box-sizing:content-box; -moz-box-sizing:content-box; -webkit-box-sizing:content-box;}\r\n\r\n/* \r\n    User Style:\r\n    Change the following styles to modify the appearance of Colorbox.  They are\r\n    ordered & tabbed in a way that represents the nesting of the generated HTML.\r\n*/\r\n#cboxOverlay{background:#fff; opacity: 0.9; filter: alpha(opacity = 90);}\r\n#colorbox{outline:0;}\r\n    #cboxTopLeft{width:25px; height:25px; background:url(/themes/eg/images/border1.png) no-repeat 0 0;}\r\n    #cboxTopCenter{height:25px; background:url(/themes/eg/images/border1.png) repeat-x 0 -50px;}\r\n    #cboxTopRight{width:25px; height:25px; background:url(/themes/eg/images/border1.png) no-repeat -25px 0;}\r\n    #cboxBottomLeft{width:25px; height:25px; background:url(/themes/eg/images/border1.png) no-repeat 0 -25px;}\r\n    #cboxBottomCenter{height:25px; background:url(/themes/eg/images/border1.png) repeat-x 0 -75px;}\r\n    #cboxBottomRight{width:25px; height:25px; background:url(/themes/eg/images/border1.png) no-repeat -25px -25px;}\r\n    #cboxMiddleLeft{width:25px; background:url(/themes/eg/images/border2.png) repeat-y 0 0;}\r\n    #cboxMiddleRight{width:25px; background:url(/themes/eg/images/border2.png) repeat-y -25px 0;}\r\n    #cboxContent{background:#fff; overflow:hidden;}\r\n        .cboxIframe{background:#fff;}\r\n        #cboxError{padding:50px; border:1px solid #ccc;}\r\n        #cboxLoadedContent{margin-bottom:20px;}\r\n        #cboxTitle{position:absolute; bottom:0px; left:0; text-align:center; width:100%; color:#999;}\r\n        #cboxCurrent{position:absolute; bottom:0px; left:100px; color:#999;}\r\n        #cboxLoadingOverlay{background:#fff url(/themes/eg/images/loading.gif) no-repeat 5px 5px;}\r\n\r\n        /* these elements are buttons, and may need to have additional styles reset to avoid unwanted base styles */\r\n        #cboxPrevious, #cboxNext, #cboxSlideshow, #cboxClose {border:0; padding:0; margin:0; overflow:visible; width:auto; background:none; }\r\n        \r\n        /* avoid outlines on :active (mouseclick), but preserve outlines on :focus (tabbed navigating) */\r\n        #cboxPrevious:active, #cboxNext:active, #cboxSlideshow:active, #cboxClose:active {outline:0;}\r\n\r\n        #cboxSlideshow{position:absolute; bottom:0px; right:42px; color:#444;}\r\n        #cboxPrevious{position:absolute; bottom:0px; left:0; color:#444;}\r\n        #cboxNext{position:absolute; bottom:0px; left:63px; color:#444;}\r\n        #cboxClose{position:absolute; bottom:0; right:0; display:block; color:#444;}\r\n\r\n/*\r\n  The following fixes a problem where IE7 and IE8 replace a PNG\\\'s alpha transparency with a black fill\r\n  when an alpha filter (opacity change) is set on the element or ancestor element.  This style is not applied to or needed in IE9.\r\n  See: http://jacklmoore.com/notes/ie-transparency-problems/\r\n*/\r\n.cboxIE #cboxTopLeft,\r\n.cboxIE #cboxTopCenter,\r\n.cboxIE #cboxTopRight,\r\n.cboxIE #cboxBottomLeft,\r\n.cboxIE #cboxBottomCenter,\r\n.cboxIE #cboxBottomRight,\r\n.cboxIE #cboxMiddleLeft,\r\n.cboxIE #cboxMiddleRight {\r\n    filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=#00FFFFFF,endColorstr=#00FFFFFF);\r\n}\r\n\r\n.showMenu{\r\n	float: right;\r\n	display: none;\r\n	padding: 16px;\r\n	font-size: 25px;\r\n	color: #222;\r\n	margin: 10px 0;\r\n	cursor:pointer;\r\n}\r\n\r\n#sentMsg{\r\n	color: #fff;\r\n	display: none; \r\n	font-size: 16px;\r\n	margin: 20px;\r\n}\r\n\r\n/******** Useful Links ********/\r\n#useful_links .ttl_group{\r\n    text-align: center;\r\n    width: 60%;\r\n    margin: 10px auto 20px;\r\n}\r\n\r\n#useful_links .ttl_group h1{\r\n    color: #06286B;\r\n    font-size: 20px;\r\n    font-weight: bold;\r\n    line-height: 110%;\r\n    margin: 0 0 10px 0;   \r\n    text-transform: uppercase;\r\n    text-shadow: 0 1px 0 rgb(255, 255, 255);\r\n}\r\n\r\n#useful_links .ttl_group span{\r\n    background: #1D286B;\r\n    width: 40px;\r\n    height: 3px;\r\n    display: block;\r\n    margin: auto;\r\n    text-shadow: 0 1px 0 rgb(255, 255, 255);\r\n}\r\n\r\n\r\n\r\n.cat_item{\r\n    margin-bottom: 12px;\r\n    padding-bottom: 12px;\r\n    border-bottom: 1px solid #E0E0E0;\r\n    -webkit-box-shadow: 0 1px 1px 0 rgba(255, 255, 255, 0.5);\r\n    box-shadow: 0 1px 1px 0 rgba(255, 255, 255, 0.5);\r\n}\r\n\r\n.cat_item h2{\r\n	font-size: 16px;\r\n    text-transform: uppercase;\r\n    font-weight: 600;\r\n}\r\n\r\n.link_cat_item{\r\n    display: block;\r\n    background: #fff;\r\n    color: #444;\r\n    padding: 12px 20px;\r\n    font-size: 15px;\r\n    margin: 6px 10px 6px 0;\r\n    -webkit-box-shadow: 0px 2px 2px rgba(0, 0, 0, 0.1);\r\n    -moz-box-shadow: 0px 2px 2px rgba(0, 0, 0, 0.1);\r\n    box-shadow: 0px 2px 2px rgba(0, 0, 0, 0.1);\r\n}\r\n\r\n.link_cat_item a{\r\n    background: #1D286B;\r\n    font-weight: 600;\r\n    font-size: 12px;\r\n    margin: 6px 0 0 0;\r\n    display: inline-block;\r\n    color: #fff;\r\n    padding: 4px 9px;\r\n    text-transform: uppercase;\r\n}\r\n\r\n/******** End Useful Links 