px;\r\n	overflow: hidden;\r\n}\r\n\r\n.propertyItem:hover{\r\n	opacity:0.85;\r\n}\r\n\r\n.status{\r\n	background: rgba(229, 0, 0, 0.85);\r\n	color: #fff;\r\n	border: 3px solid #fff;\r\n	text-align: center;\r\n	position: absolute;\r\n	padding: 8px 13px;\r\n	top: 29px;\r\n	font-size: 15px;\r\n	letter-spacing: 0.05em;\r\n	font-weight: normal;\r\n	left: 15px;\r\n	-ms-transform: rotate(-12deg);\r\n	-webkit-transform: rotate(-12deg);\r\n	transform: rotate(-12deg);\r\n	text-shadow: 1px 1px 1px rgba(0, 0, 0, 0.55);\r\n	text-transform: uppercase;\r\n	-webkit-box-shadow: 2px 2px 5px 0 #000000;\r\n	box-shadow: 1px 1px 9px 0 #000000;\r\n}\r\n\r\n.rent_status{\r\n	background: rgba(15, 169, 128, 0.85);\r\n}\r\n\r\n.status_sold{\r\n	background: rgba(25, 76, 144, 0.85);\r\n}\r\n\r\n.imgHolder{\r\n	height:220px;\r\n	overflow:hidden;\r\n	\r\n}\r\n\r\n\r\n.property_s_descr{\r\n	margin: 10px 0;\r\n	font-size: 14px;\r\n	line-height: 140%;\r\n}\r\n	\r\n/*CAROUSEL STYLE*/\r\n.arrow{\r\n	position:absolute;\r\n	background: #4B77CF;\r\n	width: 40px;\r\n	height: 42px;\r\n	text-align: center;\r\n	z-index: 10;\r\n	color: #fff;\r\n	font-size: 35px;\r\n	margin: 20px auto;\r\n	cursor:pointer;\r\n}\r\n\r\n.arrow_bottom{\r\n	position:absolute;\r\n	width: 40px;\r\n	height: 42px;\r\n	text-align: center;\r\n	z-index: 10;\r\n	color: #fff;\r\n	font-size: 35px;\r\n	cursor:pointer;\r\n}\r\n\r\n.thumb{\r\n	display: inline-block;\r\n	  margin-left: -4px;\r\n	vertical-align: top;\r\n	width: 110px;\r\n	text-align: center;\r\n}\r\n\r\n#r_arrow{\r\n	right:0;\r\n}\r\n\r\n#l_arrow{\r\n	left:0;\r\n}\r\n#propCar{\r\n	padding-left:50px;\r\n}\r\n\r\n\r\n#bottom_arrow_l{\r\n	left: 0;\r\n	background: -moz-linear-gradient(left, rgba(0,0,0,0.64) 0%, rgba(125,185,232,0) 100%);\r\n	background: -webkit-gradient(linear, left top, right top, color-stop(0%,rgba(0,0,0,0.64)), color-stop(100%,rgba(125,185,232,0)));\r\n	background: -webkit-linear-gradient(left, rgba(0,0,0,0.64) 0%,rgba(125,185,232,0) 100%);\r\n	background: -o-linear-gradient(left, rgba(0,0,0,0.64) 0%,rgba(125,185,232,0) 100%);\r\n	background: -ms-linear-gradient(left, rgba(0,0,0,0.64) 0%,rgba(125,185,232,0) 100%);\r\n	background: linear-gradient(to right, rgba(0,0,0,0.64) 0%,rgba(125,185,232,0) 100%);\r\n	filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#a3000000\', endColorstr=\'#007db9e8\',GradientType=1 );\r\n}\r\n\r\n#bottom_arrow_r{\r\n	right: 0;\r\n	background: -moz-linear-gradient(left, rgba(125,185,232,0) 1%, rgba(0,0,0,0.64) 99%);\r\n	background: -webkit-gradient(linear, left top, right top, color-stop(1%,rgba(125,185,232,0)), color-stop(99%,rgba(0,0,0,0.64)));\r\n	background: -webkit-linear-gradient(left, rgba(125,185,232,0) 1%,rgba(0,0,0,0.64) 99%);\r\n	background: -o-linear-gradient(left, rgba(125,185,232,0) 1%,rgba(0,0,0,0.64) 99%);\r\n	background: -ms-linear-gradient(left, rgba(125,185,232,0) 1%,rgba(0,0,0,0.64) 99%);\r\n	background: linear-gradient(to right, rgba(125,185,232,0) 1%,rgba(0,0,0,0.64) 99%);\r\n	filter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#007db9e8\', endColorstr=\'#a3000000\',GradientType=1 );\r\n}\r\n\r\n.carousel{\r\n  background: rgba(0,0,0, 0.8);\r\n  position: relative;\r\n  padding: 12px 0;\r\n  height: 70px;\r\n    overflow: hidden;\r\n}\r\n\r\n\r\n.carousel_bottom{\r\n	height:60px;\r\n	overflow:hidden;\r\n\r\n	z-index: 99999;\r\n}\r\n\r\n#propSale{\r\n	height: 90px;\r\n	width:100%;\r\n	position: relative;\r\n}\r\n\r\n\r\n#pic_carousel{\r\n	height: 90px;\r\n	width:100%;\r\n	position: relative;\r\n}\r\n\r\n\r\n.thumb img{\r\n	height: 75px;\r\n	width: calc(100% - 4px);\r\n	border:2px solid #FFF;\r\n	opacity:0.7;\r\n	-webkit-transition: all 0.3s ease;\r\n	-moz-transition: all 0.3s ease;\r\n	-ms-transition: all 0.3s ease;\r\n	-o-transition: all 0.3s ease;\r\n	transition: all 0.3s ease;\r\n}\r\n\r\n\r\n.subtitle{\r\n	font-size:11px;\r\n	margin-top:3px;\r\n}\r\n\r\n\r\n.preview_sm img{\r\n	height: 50px;\r\n	  margin: auto;\r\n    width: 90px;\r\n	border: